const TrendingCrypto = ({ price, name }) => {
  const { usd } = price;
  return (
    <div className="trending-list">
      <img
        className="trending-logo"
        src={require("../images/bitcoin_logo.png")}
        alt=""
      />
      <p className="trending-name">Bitcoin</p>
      <p>${usd}</p>
    </div>
  );
};

export default TrendingCrypto;
